import React, { useEffect } from 'react'
import { useNavigate } from 'react-router-dom'

function Dashboard() {
    const history = useNavigate();
    useEffect(() => {
        if (localStorage.getItem('token')) {
            history("/dashboard")
        }
        else {
            history("/")
        }
    }, [])
    return (
        <div>
            <h1>This is a Dashboard</h1>
        </div>
    )
}

export default Dashboard
